INSERT INTO "TourDetail" ("Id", "ImageId", "CroppedId", "ThumbnailId", "Title", "DateCreated", "Description") VALUES (2, 5306, 1, NULL, 'Bo Burnham', '2010-07-23 10:15:25.386696', 'Bo Burnham is a 19 year-old American comedian making his debut at the Fringe with his show ""Words, Words, Words"". Bo performs songs that toy with language, showcasing his intricate wordplay and ability to pack jokes one on top of the other. In ""Words. Words. Words,"" you will hear songs, stand-up, haikus, statistics, pornography rendered in a Shakespearean sonnet, and a bunch of other things that will make you think, laugh, and then think to yourself, ""Wait, why did I just laugh?"" They say you need 10 years to become a good comedian.
INSERT INTO "TourDetail" ("Id", "ImageId", "CroppedId", "ThumbnailId", "Title", "DateCreated", "Description") VALUES (3, 5306, 2, NULL, 'Dylan Moran', '2010-07-26 14:04:11.095763', 'Moran first came to public attention when he won Channel 4’s SO YOU THINK YOU''RE FUNNY, followed three years later by the PERRIER AWARD. Since those early stand-up beginnings Moran has had huge success as both a writer and a performer. The SIMON NYE comedy, HOW DO YOU WANT ME established him as a serious acting talent. Three series of the channel 4’s sitcom BLACK BOOKS followed winning him a Bafta and a Bronze Rose of Montreux before MORAN turned his back on the huge financial incentives for a further series and lay grumpy Bernard and witless assistant Mani to rest. MORAN‘S film career has included the smash hit ‘Rom-Com-Zom’ SHAUN OF THE DEAD alongside SIMON PEGG, THE ACTORS opposite MICHAEL CAINE and MICHAEL GAMBON. NOTTING HILL and MICHAEL WINTERBOTTOM’S A COCK AND BULL STORY. MORAN teamed-up with PEGG once again to star in DAVID SCHWIMMER’S directorial debut RUN FAT BOY RUN.
